width: 340px;
height: auto;
background-color: #666666;
margin-top: 20px;
border-radius: 15px;
`;

export const Quantity1 = styled.View`

background-color: rgba(78,78,78,0.5);
flex-direction: row;
align-items: center;
align-self:flex-end;
justify-content:center;
border-radius: 15px;
width:72px;
height:32px;
margin:15px 15px 0 0;
`;

export const QtyText1 = styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 300;
font-size: 14px;
line-height: 16px;
letter-spacing: -0.333333px;
color: #FFFFFF;
`;

export const ButtonText1 = styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 300;
font-size: 18px;
line-height: 21px;
